function Contato() {
  return (
    <div className="container">
      <div className="email">
        <i>
          <i class="fa-solid fa-envelope"></i> E-mail:
          talitacastrofreitas@gmail.com
        </i>
      </div>

      <div className="telefone">
        <i><i class="fa-brands fa-whatsapp"></i> Telefone: (71) 99411-8157</i>
      </div>
    </div>
  );
}

export default Contato;
